n -->\n		<div id=\"billing\" ng-if=\"billing && form.fields.billing.attributes.free !== true\">\n			<h2>Billing Information</h2>\n			<table>\n				<tbody>\n					<tr ng-if=\"orderNumber\">\n						<td class=\"field\">Order Number</td>\n						<td class=\"response\">{{orderNumber}}</td>\n					</tr>\n					<tr>\n						<td class=\"field\">Date</td>\n						<td class=\"response\">{{date | date:\'MM/dd/yyyy\'}}</td>\n					</tr>\n					<tr ng-if=\"billing.name\">\n						<td class=\"field\">Name</td>\n						<td class=\"response\">{{billing.name.first}} {{billing.name.last}}</td>\n					</tr>\n					<tr ng-if=\"billing.address.street1\">\n						<td class=\"field\">Address</td>\n						<td class=\"response\">\n							{{billing.address.street1}} {{billing.address.street2}}\n							<br> {{billing.address.city}}, {{billing.address.state}} {{billing.address.postalCode}} {{billing.address.country}}\n						</td>\n					</tr>\n					<tr ng-if=\"billing.paymentMethod\" ng-switch=\"billing.paymentMethod\">\n						<td class=\"field\">Payment Method</td>\n						<td class=\"response\" ng-switch-when=\"card\">Credit Card</td>\n						<td class=\"response\" ng-switch-when=\"check\">Bank Account</td>\n						<td class=\"response\" ng-switch-when=\"offline\">{{offline.label}}</td>\n					</tr>\n					<tr ng-if=\"billing.paymentMethod\">\n						<td class=\"field\" ng-switch=\"billing.paymentMethod\">\n							<span ng-switch-when=\"card\">Credit Card</span>\n							<span ng-switch-when=\"check\">Check</span>\n							<span ng-switch-when=\"offline\">Payment Instructions</span>\n						</td>\n						<td class=\"response\" ng-switch=\"billing.paymentMethod\">\n							<span ng-switch-when=\"card\">{{billing.card.cardNumber}}</span>\n							<span ng-switch-when=\"check\">{{billing.check.accountNumber}}</span>\n							<span ng-switch-when=\"offline\" style=\"white-space: pre-wrap;\">{{offline.instructions}}</span>\n						</td>\n					</tr>\n					<tr ng-if=\"billing.email\">\n						<td class=\"field\">Email</td>\n				