cting -->\n<div ng-cloak class=\"form-message\" ng-if=\"place < 0\">\n	<p>\n		<i class=\"fa fa-spinner fa-spin\"></i> Connecting..... Please wait a moment\n	</p>\n</div>\n\n<!-- EVENT: Form Open -->\n<div ng-cloak ng-if=\"status === \'open\' && place == 0 && !actionError && !maintenance\" ng-init=\"checkpoint(100)\">\n	<form id=\"campaignForm\" name=\"campaignForm\" class=\"campaign-form {{design.body.labelPlacement}} {{design.body.labelStyle}}\" ng-class=\"{\'multi-reg\': isMultireg}\" novalidate form method=\"POST\">\n		<!--- header -->\n		<section id=\"header-registrant-{{key}}\" class=\"field-{{field.type}}\" ng-repeat=\"(key, field) in header.children track by field.id\" ng-class=\"field.type === \'banner\' && field.attributes.fullWidth ? \'full-width-field\' : \'header-field\'\" ng-show=\"field._attributes.visible\" ng-style=\"fullWidthStyles(field.attributes.fullWidthType,field.attributes.image, field.attributes.backgroundColor,field.attributes.minHeight, field.attributes.background_image_placement)\">\n			<div class=\"header-field\" ng-if=\"field.type === \'banner\' && field.attributes.fullWidth\"><registration-field data-always-show=\"true\" ng-show=\"field._attributes.visible\"></registration-field></div>\n			<registration-field ng-if=\"field.type !== \'banner\' || !field.attributes.fullWidth\" data-always-show=\"true\" ng-show=\"field._attributes.visible\"></registration-field>\n			<div class=\"color-overlay\" ng-if=\"field.type === \'banner\' && field._attributes.fullWidthType === \'image\' && field._attributes.colorOverlay\" ng-style=\"{\'background-color\':field._attributes.imageOverlayColor}\"></div>\n		</section>\n\n		<!-- reserved seating -->\n		<div ng-if=\"reservedSeatingData\">\n			<react-component name=\"ReservedSeating\" props=\"reservedSeatingData.props\" watch-depth=\"reference\" />\n		</div>\n\n		<!--- tickets -->\n		<tickets ng-if=\"tickets\" tickets=\"tickets\" ng-click=\"formInitClick(200)\"></tickets>\n\n		<div ng-if=\"!reservedSeatingDa